import React, { PureComponent } from 'react';

//Component
import Hearder from './component/Header';
import Todolist from './component/TodoList';
import Footer from './component/Footer'

//Css
import './App.css';
import './css/Todo.css';


class App extends PureComponent{

  render(){
    return (
      <div className="todoapp">
          <Hearder />
          <Todolist />
          <Footer />
      </div>
    );
  }

}

export default App;
